import React, { Image } from "react";

import Header from "./Header";
import Footer from "./Footer";


function App() {
  return (
    <>
      <Header />
      <Image className="logo" source={"/images/mesha-logo.png"} />
      <Footer />
    </>
  );
}

export default App;
